import TransportAppHeader from "./Components/TransportAppHeader.vue";
import TransportAppMain from "./Pages/TransportAppMain.vue";
import CdnResolverImage from "@/Components/CdnResolverImage.vue";
export default {
  data() {
    return {
      isCalling: false,
      currentTransportIndex: 0,
      lastType: ""
    };
  },
  computed: {
    currentTransport() {
      if (this.carList.length === 0) return null;
      return this.carList[this.currentTransportIndex];
    },
    carList() {
      return this.$store.getters["playerMenu/getCarsList"] || [];
    }
  },
  methods: {
    moveIndex(type) {
      this.lastType = type;
      if (type === "-") {
        if (this.currentTransportIndex !== 0) {
          this.currentTransportIndex--;
        }
      } else {
        if (this.currentTransportIndex !== this.carList.length - 1) {
          this.currentTransportIndex++;
        }
      }
    },
    movePerIndex(type) {
      const item = this.carList[this.currentTransportIndex];
      if (type === "-") {
        if (this.currentTransportIndex !== 0) {
          this.$callClient("W:Phone:Transport:moveIndex", item.UUID, false);
        }
      } else {
        if (this.currentTransportIndex !== this.carList.length - 1) {
          this.$callClient("W:Phone:Transport:moveIndex", item.UUID, true);
        }
      }
    }
  },
  components: {
    TransportAppHeader,
    TransportAppMain,
    CdnResolverImage
  }
};
